import * as React from 'react';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Navbar from '../Components/Navbar';
import Login from '../Components/Login';
import img from '../assets/note.jpg' // Replace with the actual path to your image

export default function Home() {
    const paperstyle = { width: 1200 }; // Remove height and marginTop

    return (
        <>
            <Navbar />
            <Grid container justifyContent="center">
                <Paper elevation={3} style={{ ...paperstyle, padding: 20, minHeight: '60vh' }}>
                    <Grid container spacing={3} justifyContent="center">
                        <Grid item xs={12} sm={6}>
                            <img src={img} alt="Description of your image" style={{ width: '100%', height: 'auto', objectFit: 'cover' }} />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <Login />
                        </Grid>
                    </Grid>
                </Paper>
            </Grid>
        </>
    );
}



